import React from 'react';
import './Node.css';

const Node = ({ isStart, isEnd, searched, isPath, row, col }) => {
    const classes = isStart ? "node_start" : isEnd ? "node_end" : isPath ? "node_path" : "";
    const dragAble = isStart ? true : isEnd ? true : false;

    const onDropFun = (e) => {
        e.preventDefault()
        let data = e.dataTransfer.getData("Text")
        e.target.appendChild(document.getElementById(data))
        e.nativeEvent.dataTransfer.dropEffect = "copy";
        console.log(e.nativeEvent.dataTransfer.dropEffect)

    }

    return (
        <div
            className={`node ${classes}`}
            id={`node-${row}-${col}`}
            draggable={dragAble}
            onDragStart={(e) => (e.dataTransfer.setData("Text", e.target.id))}
            onDrop={(e) => (onDropFun(e))}
            onDragOver={(e) => (e.preventDefault())}
        >

        </div>
    )
}

export default Node;
